export const initialState = {
    id: "79mWpD",
    title: "Lespo",
    typeVariant: 0,
    price: 3.43,
    inputs: {
        username: {
            label: "Enter your nickname",
            value: "",
        },
        twitch: {
            label: "Your channel",
            value: "",
        },
        facebook: {
            label: "Specify your facebook link",
            value: "",
        },
    }
}

export function orderFormReducer(state = initialState, action) {
    switch (action.type) {
        case '':
            return {...state,}

        default:
            return state
    }
}
